angular.module("ionic.metApp.filters",["ionic.metApp.services"]).filter("temp",function(t){return function(e){return"f"==t.getTempUnits()?e.fahrenheit:e.celsius}}).filter("tempEnglish",function(t){return function(e){return"f"==t.getTempUnits()?e.english:e.metric}}).filter("tempInt",function(){return function(t){return parseInt(t)}});